import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Locate and click the cart icon. The target is a div with the class 'cart'.
    const cartIcon = page.locator('div.cart');
    await cartIcon.waitFor({ state: 'visible', timeout: 5000 });
    await cartIcon.click();

    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_clicked.png'));

    // Wait for the modal container to become visible.
    // The CSS indicates a generic '.modal' class is used for modals and is initially hidden.
    const modalLocator = page.locator('.modal');
    await modalLocator.waitFor({ state: 'visible', timeout: 5000 });

    // Verify the modal is visible and extract this information.
    const isModalVisible = await modalLocator.isVisible();
    if (!isModalVisible) {
      throw new Error('Shopping cart modal did not become visible after click.');
    }

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_modal_visible.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_modal_visible.png'));

    return {
      success: true,
      action: "Opened the shopping cart modal",
      extractedData: {
        isModalVisible: isModalVisible
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to open shopping cart modal",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
